spring:
  application:
    name: dubbo-provider
server:
  port: 8081
  context-path: /dubbo-provider
management:
  port: 9091
dubbo:
  scan:
    basePackages: t5750.dubbo.service
  application:
    id: dubbo-provider
    name: dubbo-provider
  protocol:
    id: dubbo
    name: dubbo
    port: 20880
  registry:
    address: zookeeper://192.168.100.163:2181?backup=192.168.100.164:2181,192.168.100.165:2181
    id: zookeeper-registry